// PetDetails.js
import React from 'react';
import { useParams } from 'react-router-dom';

const PetDetails = (props) => {
  const { petId } = useParams();
  const { petData } = props.location.state;

  // Use petData to display pet details
  // For example: petData.age, petData.gender, etc.

  return (
    <div>
      <h2>{petData.name}</h2>
      <p>Age: {petData.age}</p>
      <p>Gender: {petData.gender}</p>
      {/* Display other pet details here */}
    </div>
  );
};

export default PetDetails;
